const PostsList = (user, title, text) => {
    const [data, setData] = useState([])

    useEffect(() => {
        fetch("/api/posts")
            .then(response => response.json())
            .then(json => setData(json))
    }, [])

    return (
        <div>
            <ul>
                {data.map((post) => {
                    <Post user={post.user} title={post.title} text={post.text}></Post>
                })}
            </ul>
        </div>
    )
}

export default PostsList;
